import React, {useState, useEffect, useContext} from 'react'
import {Link, useParams, useHistory} from 'react-router-dom'
import petSelfService from "../services/self-created-pet-service"
import userService from "../services/user-service";

const ProfilePage = () => {
    const {userId} = useParams()
    const [contact, setContact] = useState([{}])
    const  history = useHistory();

    useEffect(() => {
        findUserByUserId(userId)
    }, [])

    const findUserByUserId = (userId) => {
        userService.findUserByUserId(userId)
            .then((data) => {
                setContact(data)
            })
        console.log(contact)
    }
    return(
        <div>
            <button onClick={() => {history.goBack()}}>Back</button>
            {JSON.stringify(contact)}
            {
                contact &&
                    <>
                        <ul>
                            {

                                <li className="list-group-item" key={contact.userId}>

                                    {
                                        petResult[0].breed &&
                                        <h3>Breeds: {petResult[0].breed}</h3>
                                    }
                                    <h3>Gender: {petResult[0].gender}</h3>
                                    <h3>ID: {petResult[0].petId}</h3>
                                    <h3>Age: {petResult[0].age}</h3>
                                    <h3>Status: {petResult[0].status}</h3>
                                    <Link to={`/profile/${petResult[0].userId}`}>
                                        <h3>Contact Information: {petResult[0].userId}</h3>
                                    </Link>
                                    <br/>
                                    <br/>

                                </li>
                            }
                        </ul>

                    </>
            }

        </div>
    )

}

export default ProfilePage
